import PostInfoContainer from './PostInfo/PostInfoContainer';
import Preloader from '../common/Preloader/Preloader';



const Profile = (props) => {

if(!props.profile){
    return <Preloader />
}

    return (
        <div>
            <Avatar profile={props.profile} status={props.status} />
            <PostInfoContainer />

        </div>
    )
}

export default Profile;
